import React from "react";

const thumbnailStyle = {
    position: "fixed",
    top: 0,
    display: "flex",
    flexDirection: "row",
    justifyContent: "space-evenly",
    alignItems: "center",
    width: "100%",
    fontWeight: "bold",
    padding: "0px 20px",
    boxSizing: "border-box"
};



export const Thumbnail = ({ ...props }) => (
    <div style={thumbnailStyle}>
        {props.children}
    </div>
)

export default Thumbnail;
